// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

interface IVote {
    // 核心功能接口;
    function registerVoter(address _voter) external; // 注册投票者
    function createChooseTeacherProposal(string memory _description, uint[] memory _votedIds,uint _totalVote) external returns (uint); // 创建提案
    function createChooseCourseProposal(string memory _description, uint[] memory _votedIds,uint _totalVote) external returns (uint); // 创建提案
    function voteChooseTeacher(address voter, uint _proposalId, uint _voteId) external; // 投票
    function voteChooseCourse(address voter, uint _proposalId, uint _voteId) external; // 投票
    function endVoteChooseTeacher(uint _proposalId) external view returns (uint); // 结束投票
    function endVoteChooseCourse(uint _proposalId) external view returns (uint); // 结束投票
    
    // 查询接口
    function getVotedIds(uint _proposalId) external view returns (uint[] memory); // 获取某个提案被投票的选项的ids
    function getVoteIdToCount(uint _proposalId, uint _voteId) external view returns (uint); // 获取某个提案某个选项的票数
}

// 在合约里面可以写的丰富一些，函数
contract VoteCaller {
    // 通过接口调用注册功能
    function registerVoterViaInterface(address voteAddress,address voterAddress) public {
        IVote(voteAddress).registerVoter(voterAddress);
    }

    // 通过接口创建提案
    // 创建选老师提案
    function createChooseTeacherProposalViaInterface(address voteAddress,string memory _description, uint[] memory _votedIds,uint _totalVote) public {
        IVote(voteAddress).createChooseTeacherProposal(_description, _votedIds, _totalVote);
    }
    // 创建选课程提案
    function createChooseCourseProposalViaInterface(address voteAddress,string memory _description, uint[] memory _votedIds,uint _totalVote) public {
        IVote(voteAddress).createChooseCourseProposal(_description, _votedIds, _totalVote);
    }

    // 通过接口投票
    // 选老师投票
    function voteChooseTeacherViaInterface(address voteAddress,address voterAddress, uint _proposalId, uint _voteId) public {
        IVote(voteAddress).voteChooseTeacher(voterAddress, _proposalId, _voteId); 
    }
    // 选课程投票
    function voteChooseCourseViaInterface(address voteAddress,address voterAddress, uint _proposalId, uint _voteId) public {
        IVote(voteAddress).voteChooseCourse(voterAddress, _proposalId, _voteId); 
    }

    // 通过接口结束投票
    // 选老师结束投票
    function endVoteChooseTeacherViaInterface(address voteAddress, uint _proposalId) public view returns (uint) {
        return IVote(voteAddress).endVoteChooseTeacher(_proposalId); 
    }

    // 选课程结束投票
    function endVoteChooseCourseViaInterface(address voteAddress, uint _proposalId) public view returns (uint) {
        return IVote(voteAddress).endVoteChooseCourse(_proposalId); 
    }

    // 通过接口查询投票信息
    function getVotedIdsViaInterface(address voteAddress, uint _proposalId) public view returns (uint[] memory) {
        return IVote(voteAddress).getVotedIds(_proposalId);
    }

    // 通过接口查询某个选项投票票数
    function getVoteIdToCountViaInterface(address voteAddress, uint _proposalId, uint _voteId) public view returns (uint) {
        return IVote(voteAddress).getVoteIdToCount(_proposalId, _voteId);
    }
}
